import React from "react";
import { Bar } from "react-chartjs-2";

export default function Char() {
  return (
    <>
      <div className="Container mx-4">
        <Bar
          data={{
            labels: [1, 2, 3, 4, 5],
            datasets: [
              {
                label: "this is first",
                data: [12, 14, 17, 12],
              },
            ],
          }}
        />
      </div>
    </>
  );
}
